import React from 'react';
import classes from './TaskList.module.css';

const TaskRender = (props) => {
  return (
    <ul className={classes.container} key={props.id}>
      <li className={classes.task}>
        <h2>{props.title}</h2>
        <h3>{props.date}</h3>
      </li>
    </ul>
  );
};

export default TaskRender;
